If you are generating the options for the dropdown list from an SQL query, you can make the dropdown list not have an option initially selected by adding an additional option element with the `selected` attribute before the options generated from the query.
Here is an example of how you could do it in PHP:
```php
<select id="exampleSelect">
  <option value="" selected disabled hidden>Select an option</option>
  <?php
    $conn = mysqli_connect("hostname", "username", "password", "database");
    $result = mysqli_query($conn, "SELECT id, name FROM table_name");
    while ($row = mysqli_fetch_array($result)) {
        echo '<option value="' . $row['id'] . '">' . $row['name'] . '</option>';
    }
  ?>
</select>
```
